import styled from "styled-components";
import { motion } from "framer-motion";
import TitleComponent from "../components/title.component";
import ArticleComponent from "../components/article.component";

const MoreArticlesLayoutStyle = styled(motion.div)`
  position: relative;
  width: 93vw;
  margin-top: 150px;
  margin-left: 5vw;
  display: flex;
  justify-content: space-between;
  width: 70vw;
  flex-wrap: wrap;
`;

const MoreArticlesLayout = ({ length = 4 }) => {
  const articles = [];
  for (let index = 0; index < length; index++) {
    articles.push(
      <ArticleComponent styles="margin : 30px ; width : 300px;  margin-left : 0; " />
    );
  }

  return (
    <>
      <TitleComponent
        styles="margin-top : 200px"
        colors={{ title: "#F8F8FF", subTitle: "#8A8888" }}
        text={{
          title: "More travel articles",
          subTitle:
            "more then 250 articles talked just aboute health and gave many new views for the readers and we are sure that it’s cann change your life ",
        }}
      />
      <MoreArticlesLayoutStyle>{articles}</MoreArticlesLayoutStyle>
    </>
  );
};
export default MoreArticlesLayout;
